根目录 build.gradle 配置
在根目录 build.gradle 文件里添加需要集成的 dependencies 依赖库地址。
allprojects {
   repositories {
       //***** required start ****//
       maven { url "https://maven-other.tuya.com/repository/maven-releases/"}
       maven { url 'https://jitpack.io' }
       //***** required end ****//
       google()
       jcenter()
       mavenCentral()
   }
}

buildscript {
   repositories {
       maven {url "https://maven-other.tuya.com/repository/maven-releases/"}
       maven { url "https://jitpack.io" }
       mavenLocal()
       mavenCentral()
       google()
       jcenter()
   }
   dependencies {
       classpath 'com.android.tools.build:gradle:3.5.0'
       classpath 'com.antfortune.freeline:gradle:0.8.6'
       classpath "com.google.protobuf:protobuf-gradle-plugin:0.8.6"
       classpath 'org.apache.httpcomponents:httpclient:4.4.1'
       classpath 'com.tuya.android.module:tymodule-config:0.4.0'
   }
}


模块 build.gradle 配置
在模块 build.gradle 文件里添加集成准备中下载的 dependencies 依赖及一些配置。
apply plugin: 'com.android.application'
apply plugin: 'tymodule-config'

android {
   //... 其他默认配置
   defaultConfig {
       //...其他默认配置
       multiDexEnabled true
       ndk {
           abiFilters "armeabi-v7a", "arm64-v8a"
       }
   }

   //***** 强制配置 开始 ****//
   compileOptions {
       sourceCompatibility 1.8
       targetCompatibility 1.8
   }

   packagingOptions {
       pickFirst 'lib/*/libc++_shared.so'
       pickFirst 'lib/*/libgnustl_shared.so'
   }

   lintOptions {
       abortOnError false
       disable 'InvalidPackage'
